pragma solidity 0.6.3;
import "./Roles.sol";
import "./SafeMath.sol";
import "./CallerContractInterface.sol";
import "./CallerContract.sol";
import "./SensorValueOracleInterface.sol";

contract SensorValueOracle is SensorValueOracleInterface {
    using Roles for Roles.Role;
    Roles.Role private owners;
    Roles.Role private oracles;
    using SafeMath for uint256;
    uint256 private randNonce = 0;
    uint256 private modulus = 1000;
    uint256 private numOracles = 0;
    uint256 private THRESHOLD = 0;

    //added this
    uint256 private RepTHRESHOLD = 0;
    //added this
    mapping(address => uint256) private ReputationRecord;
    //added this
    uint256 private MaxVARIATION = 0;

    mapping(uint256 => bool) pendingRequests;
    struct Response {
        address oracleAddress;
        address callerAddress;
        uint256 sensorValue;
    }
    mapping(uint256 => Response[]) public requestIdToResponse;
    event GetLatestSensorValueEvent(address callerAddress, uint256 id);
    event SetLatestSensorValueEvent(uint256 sensorValue, address callerAddress);
    event AddOracleEvent(address oracleAddress);
    event RemoveOracleEvent(address oracleAddress, string reason);
    event SetThresholdEvent(uint256 threshold);
    //added this
    event VariationSurpassedEvent(address oracleAddress, uint256 computedSensorValue, uint256 sensorValue);

    constructor(address _owner) public {
        owners.add(_owner);
    }

    function addOracle(address _oracle) public {
        //require(owners.has(msg.sender), "Not an owner!");
        require(!oracles.has(_oracle), "Already an oracle!");
        oracles.add(_oracle);

        //added this
        ReputationRecord[_oracle] = 0;

        numOracles++;
        //emit AddOracleEvent(_oracle);
    }

    //changed here
    function removeOracle(address _oracle, string memory _reason) private {
        require(oracles.has(_oracle), "Not an oracle!");
        //require(numOracles > 1, "Do not remove the last oracle!");
        oracles.remove(_oracle);

        //added this
        delete ReputationRecord[_oracle];

        numOracles--;
        emit RemoveOracleEvent(_oracle, _reason);
    }

    //added this
    function autoDestructOracle() public {
        removeOracle(msg.sender,"Sensor is self-removing from the subsystem!");
    }

    //added this
    function updateOracleSensorsList(uint256 _id, uint256 _computedSensorValue) private {
        uint256 max = _computedSensorValue.add(MaxVARIATION);
        uint256 min = _computedSensorValue.sub(MaxVARIATION);
        for (uint256 f = 0; f < requestIdToResponse[_id].length; f++) {
            address oracle = requestIdToResponse[_id][f].oracleAddress;
            // Update Reputation Record
            if ((requestIdToResponse[_id][f].sensorValue > max) || (requestIdToResponse[_id][f].sensorValue < min)) {
                ReputationRecord[oracle] = ReputationRecord[oracle].add(1);
                emit VariationSurpassedEvent(oracle, _computedSensorValue, requestIdToResponse[_id][f].sensorValue);
            }
            // Update OracleSensorsList
            if (ReputationRecord[oracle] > RepTHRESHOLD) {
                removeOracle(oracle, "Sensor surpassed reputation threshold!");
            }
        }
    }

    function setThreshold(uint256 _threshold) public {
        //require(owners.has(msg.sender), "Not an owner!");
        THRESHOLD = _threshold;
        //    emit SetThresholdEvent(THRESHOLD);
    }

    //added this
    function setReputationParameters(uint256 _RepThreshold, uint256 _MaxVariation) public {
        //require(owners.has(msg.sender), "Not an owner!");
        RepTHRESHOLD = _RepThreshold;
        MaxVARIATION = _MaxVariation;
        //    emit SetReputationParametersEvent(RepTHRESHOLD, MaxVARIATION);
    }

    function getLatestSensorValue() public override returns (uint256) {  
        randNonce++;
        uint256 id = uint256(
            keccak256(abi.encodePacked(now, msg.sender, randNonce))
        ) % modulus;
        pendingRequests[id] = true;
        emit GetLatestSensorValueEvent(msg.sender, id);
        return id;
    }

    function setLatestSensorValue(
        uint256 _sensorValue,
        address _callerAddress,
        uint256 _id
    ) public {
        require(oracles.has(msg.sender), "Not an oracle!");
        require(
            pendingRequests[_id],
            "This request is not in my pending list."
        );
        Response memory resp;
        resp = Response(msg.sender, _callerAddress, _sensorValue);
        requestIdToResponse[_id].push(resp);
        uint256 numResponses = requestIdToResponse[_id].length;
        if (numResponses == THRESHOLD) {
            uint256 computedSensorValue = 0;
            //added this
            uint maxIndex = 0;
            //Initializing counting vector
            for (uint256 f = 0; f < requestIdToResponse[_id].length; f++) {
                if (requestIdToResponse[_id][f].sensorValue > maxIndex) {
                    maxIndex = requestIdToResponse[_id][f].sensorValue;
                }
            }
            uint256[] memory counting = new uint256[](maxIndex+1);
            uint mode = requestIdToResponse[_id][0].sensorValue;
            for (uint256 f = 0; f < requestIdToResponse[_id].length; f++) {
                counting[requestIdToResponse[_id][f].sensorValue] = counting[requestIdToResponse[_id][f].sensorValue].add(1);
                if (counting[requestIdToResponse[_id][f].sensorValue] > counting[mode]) {
                    mode = requestIdToResponse[_id][f].sensorValue;
                }
            }
            computedSensorValue = mode;
            //added this
            updateOracleSensorsList(_id, computedSensorValue);
            delete pendingRequests[_id];
            delete requestIdToResponse[_id];
            CallerContractInterface callerContractInstance;
            callerContractInstance = CallerContractInterface(_callerAddress);
            callerContractInstance.callback(computedSensorValue, _id);
            //emit SetLatestSensorValueEvent(computedSensorValue, _callerAddress);
        }
    }


}
